  \"2016-07-27T23:06:09.186340\",\n\t\"name\": \"lewis-and-clark-nwr-initial-survey-instructions-for-american-white-pelican-colony-survey-p\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The presence of an American White Pelican
  colony with the L&C boundary is new.  The colony appeared in 2010, possibly as a
  result of hazing upriver.  Whether this colony will persist and grow is unknown,
  but it has implications on recreational use and fisheries resources.  The growth
  and spread of this colony should be documented.  The colony is in an area where
  dredging regularly occurs and human recreation is common.  Hunting, fishing, wildlife
  viewing, boating, and kayaking are regular occurrences along the shores of Miller
  Sands.  The COE has also actively razed vegetation in this area in preparation for
  dredge material deposition.  This vegetation loss has had little effect on the colony's
  persistence, and it is believed that this area will form a permanent nesting colony.\",\n\t\"license_title\":
